INSERT INTO `posts` VALUES ('2023-11-20 00:14:25.522777','2023-11-20 00:14:51.751727',1,1,'¿Qué es la deforestación? Consecuencias y soluciones','<p>Vemos qué es la deforestación, cuál es su principal causa, sus impactos sobre el medioambiente y qué podemos hacer para frenarla.</p><p><br></p><p><img src=\"https://dkv.es/corporativo/sites/default/files/styles/crop_freeform/public/2023-08/que-es-la-deforestacion-00.jpg.webp?itok=LpyPjUpq\"></p><p><strong>Índice</strong></p><ul><li><a href=\"https://dkv.es/corporativo/blog-360/medioambiente/naturaleza/deforestacion#toc--qu-es-la-deforestaci-n-causas\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(106, 98, 90);\"><strong>¿Qué es la deforestación? Causas</strong></a></li><li><a href=\"https://dkv.es/corporativo/blog-360/medioambiente/naturaleza/deforestacion#toc--c-mo-afecta-la-deforestaci-n-al-medioambiente-\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(106, 98, 90);\"><strong>¿Cómo afecta la deforestación al medioambiente?</strong></a></li><li><a href=\"https://dkv.es/corporativo/blog-360/medioambiente/naturaleza/deforestacion#toc-deforestaci-n-y-cambio-clim-tico\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(106, 98, 90);\"><strong>Deforestación y cambio climático</strong></a></li><li><a href=\"https://dkv.es/corporativo/blog-360/medioambiente/naturaleza/deforestacion#toc--qu-hacer-para-prevenir-la-deforestaci-n-\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(106, 98, 90);\"><strong>¿Qué hacer para prevenir la deforestación?</strong></a></li><li><a href=\"https://dkv.es/corporativo/blog-360/medioambiente/naturaleza/deforestacion#toc-preguntas-frecuentes-faqs\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(106, 98, 90);\"><strong>Preguntas frecuentes - FAQs</strong></a></li></ul><p><br></p><p>El diccionario de la Real Academia Española define deforestar como «Despojar un terreno de plantas y árboles». Algunas&nbsp;<a href=\"https://dkv.es/corporativo/blog-360/sociedad/accion-social/que-son-las-ong\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(152, 169, 42);\">ONG</a>&nbsp;denuncian que en poco más de una década se han<strong>&nbsp;arrasado 43 millones de hectáreas de bosque en el mundo</strong>, una superficie equivalente al estado de California. Además de la destrucción de hábitats o la pérdida irreparable de biodiversidad, la&nbsp;<strong>deforestación&nbsp;<em>aviva&nbsp;</em>el calentamiento global.</strong>&nbsp;Te contamos lo que debes saber acerca de este problema y sus posibles soluciones.</p><h2>¿Qué es la deforestación? Causas</h2><p>La deforestación es un proceso en el que se&nbsp;<strong>agota o destruye por completo la superficie forestal.</strong>&nbsp;Aunque su origen puede ser natural, está&nbsp;<strong>provocado principalmente por la actividad humana.&nbsp;</strong>La tala indiscriminada de bosques atiende a muchos motivos, pero la mayoría están relacionados con la agricultura y los intereses económicos de la industria maderera.</p><p>Según el informe<a href=\"https://www.wwf.es/?55920/Informe-Frentes-de-Deforestacion\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(152, 169, 42);\">&nbsp;<em>Frentes de Deforestación; causas y respuestas en un mundo cambiante</em></a>, publicado en 2021 por el Fondo Mundial para la Naturaleza (WWF, por sus siglas en inglés), la&nbsp;<strong>agricultura comercial</strong>&nbsp;<strong>destaca como una de las principales causas de la pérdida de bosques</strong>&nbsp;alrededor del mundo.</p><p>Hectáreas de terreno arbolado se despejan a fin de obtener&nbsp;<strong>espacio para los cultivos y el ganado.</strong>&nbsp;Por regiones, en Latinoamérica las mayores responsables de la deforestación son la ganadería y la agricultura a gran escala, sobre todo el&nbsp;<strong>cultivo de soja</strong>; en Asia, las plantaciones para&nbsp;<strong>palma&nbsp;</strong>y<strong>&nbsp;pulpa de papel</strong>, y en África, la&nbsp;<strong>agricultura de subsistencia.</strong></p><p>Además de la intensificación insostenible de la producción agrícola y animal, otras causas de la deforestación son la&nbsp;<strong>tala ilegal</strong>&nbsp;y los&nbsp;<strong>incendios forestales</strong>, la minería o la expansión de áreas urbanas e industriales. También cabe citar las&nbsp;<strong>plagas</strong>&nbsp;y enfermedades que afectan a los árboles.</p><p><img src=\"https://dkv.es/corporativo/sites/default/files/2023-08/que-es-la-deforestacion-01.jpg\"></p><p>Pese a que las tasas de deforestación disminuyeron a nivel mundial un 6,3% en 2021 respecto al período 2018-20 (línea base), estamos lejos aún de alcanzar los objetivos para 2030</p><p>Entre las principales causas de la deforestación en el mundo se encuentra el avance de la «frontera» agrícola y ganadera. La imagen muestra una plantación de aceite de palma en el borde de la selva tropical. Fuente: iStock.</p><h2>¿Cómo afecta la deforestación al medioambiente?</h2><p>La deforestación tiene multitud de efectos negativos en la naturaleza e incluso en nuestra propia salud; destacan los siguientes:</p><ul><li>Los bosques son el hogar de muchas especies, tanto vegetales como animales. Así pues, el impacto más directo de la deforestación es la&nbsp;<strong>pérdida de hábitats&nbsp;</strong>de numerosas especies de fauna y flora.</li><li><br></li><li>Lo anterior se deriva en una&nbsp;<strong>merma de la&nbsp;</strong><a href=\"https://dkv.es/corporativo/blog-360/medioambiente/naturaleza/biodiversidad-salud-humana\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(152, 169, 42);\"><strong>biodiversidad</strong></a><strong>&nbsp;</strong>global.</li><li><br></li><li>El avance de la&nbsp;<a href=\"https://dkv.es/corporativo/blog360/medioambiente/que-es-la-sequia-y-como-afrontarla-desde-hogares\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(152, 169, 42);\"><strong>desertización</strong></a>, debido a la disminución de la cobertura vegetal.</li><li><br></li><li>La&nbsp;<strong>emisión de gases de efecto invernadero (GEI)</strong>&nbsp;y, por tanto, contribución al&nbsp;<a href=\"https://dkv.es/corporativo/blog-360/medioambiente/cambio-climatico/calentamiento-global-consecuencias\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(152, 169, 42);\">calentamiento global</a>.</li><li><br></li><li>La aparición de&nbsp;<strong>enfermedades zoonóticas</strong>&nbsp;como la COVID-19.</li></ul><h2>Deforestación y cambio climático</h2><p>Los bosques del mundo son grandes reservorios de carbono. Se estima que almacenan unos&nbsp;<strong>7600 millones de toneladas métricas de carbono</strong>, lo que equivale a 1,5 veces las emisiones anuales de Estados Unidos. Cuando se pierde masa arbórea debido a la deforestación, se emiten a la atmósfera enormes cantidades de CO2 favoreciendo el calentamiento global.</p><p>De acuerdo con un<a href=\"https://www.nature.com/articles/s41586-022-05679-w\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(152, 169, 42);\">&nbsp;estudio reciente publicado en&nbsp;<em>Nature</em></a>, el cambio climático, la deforestación y la degradación causada por los incendios y la tala están reduciendo la importancia de los bosques tropicales húmedos como sumideros de carbono. Lo que provoca que mucho del carbono almacenado se libere de nuevo a la atmósfera.&nbsp;</p><p>Usando<a href=\"https://www.esa.int/Applications/Observing_the_Earth/Space_for_our_climate/Recovering_forests_regain_a_quarter_of_carbon_lost_from_deforestation\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(152, 169, 42);\">&nbsp;datos de satélite de la Agencia Espacial Europea (ESA)</a>, este equipo de investigadores internacionales cuantificó las tasas de reducción de carbono en distintos tipos de bosque y entornos en los&nbsp;<strong>tres bosques tropicales más grandes: Amazonas, África Central y Borneo.</strong>&nbsp;Por hectárea, de estos tres grandes bosques, las mayores reducciones de carbono se observaron en Borneo.&nbsp;</p><p>El trabajo, dirigido por la Universidad de Bristol y el Instituto Nacional de Investigaciones Espaciales de Brasil, revela que los bosques degradados en recuperación combaten&nbsp;<strong>una cuarta parte de las emisiones actuales.&nbsp;</strong>Los bosques que se recuperan de las perturbaciones humanas&nbsp;<strong>acumulan 107 millones de&nbsp;</strong><a href=\"https://dkv.es/corporativo/blog-360/medioambiente/contaminacion/descarbonizacion\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(152, 169, 42);\"><strong>toneladas de carbono</strong></a><strong>&nbsp;al año</strong>, compensando las emisiones por la pérdida de bosques tropicales. Estos hallazgos demuestran la relevancia de conservar los bosques en recuperación al mismo tiempo que se protegen los bosques primarios.</p><p><img src=\"https://dkv.es/corporativo/sites/default/files/2023-08/que-es-la-deforestacion-02.jpg\"></p><h2>La deforestación, por sí sola, es responsable del 11 % de las emisiones globales de GEI, según datos del Grupo Intergubernamental de Expertos sobre el Cambio Climático (IPCC).¿Qué hacer para prevenir la deforestación?</h2><p>Pese a que las tasas de deforestación&nbsp;<strong>disminuyeron a nivel mundial un 6,3%&nbsp;</strong>en 2021 respecto al período 2018-20 (línea base), estamos lejos aún de alcanzar los objetivos para 2030 de detener y revertir la pérdida de bosques. Para frenar por completo la deforestación antes de final de década, declara la organización Forest Declaration Assessment en su informe<a href=\"https://forestdeclaration.org/resources/forest-declaration-assessment-2022/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(152, 169, 42);\">&nbsp;<em>Evaluación de la Declaración Forestal</em></a>, es precisa una&nbsp;<strong>reducción anual del 10% en los índices de deforestación.</strong></p><p>Por su parte, el informe de WWF propone soluciones concretas para poner fin a la deforestación. Respuestas urgentes que deben aplicarse de&nbsp;<strong>forma conjunta por gobiernos, empresas y agentes reguladores.</strong>&nbsp;Estas incluyen garantizar que los productos de origen forestal se produzcan y comercialicen legalmente y de manera sostenible, y poner en marcha políticas que aseguren que los bienes forestales importados, así como las finanzas relacionadas, estén&nbsp;<strong>«libres de deforestación».</strong></p><p>También a título individual, con acciones muy sencillas, podemos ayudar a revertir los actuales niveles de deforestación en el planeta. Por ejemplo,&nbsp;<strong>reduciendo el uso de papel</strong>&nbsp;o adquiriendo productos que contengan material —papel, cartón y madera— con&nbsp;<strong>certificado</strong><a href=\"https://fsc.org/en\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(152, 169, 42);\">&nbsp;<strong>FSC</strong></a>&nbsp;(Forest Stewardship Council) o etiqueta<a href=\"https://www.pefc.es/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(152, 169, 42);\">&nbsp;<strong>PEFC</strong></a>&nbsp;(Programme for the Endorsement of Forest Certification), que garantizan una gestión forestal responsable.</p><p>En los productos de alimentación, busca la rana verde. El&nbsp;<strong>sello Rainforest Alliance</strong>&nbsp;asegura que el ingrediente o ingredientes certificados fueron elaborados mediante prácticas que protegen los bosques nativos, evitando la expansión de tierras de cultivo y fomentando la salud de árboles y suelos.</p><p>La deforestación, por sí sola, es&nbsp;<strong>responsable del 11 % de las emisiones globales de GEI</strong>, según datos del Grupo Intergubernamental de Expertos sobre el Cambio Climático (IPCC). Esta contribuye a la&nbsp;<a href=\"https://dkv.es/corporativo/blog-360/medioambiente/cambio-climatico/cambio-climatico-causas-soluciones\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(152, 169, 42);\">crisis climática</a>&nbsp;y a la pérdida de diversidad biológica, entre otros impactos negativos. En «¿Qué es la deforestación? Consecuencias y soluciones», hemos comprobado cómo&nbsp;<strong>dejar de ser parte del problema</strong>&nbsp;para pasar a serlo de la solución.</p><p><br></p>',1,'kmarie','kmarie','data:image/webp;base64,'),('2023-11-20 02:59:31.369261','2023-11-20 03:09:35.846712',1,2,'El impacto de la contaminación en la salud y la calidad de vida','<h2>\r\n  La contaminación es un problema que ha adquirido desde hace años un carácter\r\n  global y representa un grave riesgo para la salud pública. Los datos de la OMS\r\n  indican que durante la presente década se pueden producir cerca de 250.000\r\n  muertes a causa del cambio climático, por lo que plantear estrategias que\r\n  fomenten la transición hacia un modelo de movilidad verde son decisivos para\r\n  la salud de los colectivos más vulnerables.\r\n</h2>\r\n<p>Actualizado a&nbsp;13 de febrero de 2021, 14:37</p>\r\n<p>\r\n  <a\r\n    href=\"https://www.nationalgeographic.com.es/ciencia/impacto-contaminacion-salud-y-calidad-vida_16348#\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: var(--v-colortext-actions-article-header)\"\r\n    >Guardar</a\r\n  >\r\n</p>\r\n<p><br /></p>\r\n<p><span style=\"color: rgb(0, 0, 0)\">*The Conversation</span></p>\r\n<p>\r\n  Si los nueve países que más emisiones generan logran cumplir los objetivos del\r\n  Acuerdo de París, para 2040&nbsp;<strong\r\n    >se podrían evitar 1,6 millones de muertes&nbsp;</strong\r\n  >debido a la mejora de la calidad del aire. Esta predicción procede de\r\n  un&nbsp;<a\r\n    href=\"https://www.thelancet.com/journals/lanplh/article/PIIS2542-5196(20)30249-7/fulltext\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0)\"\r\n    >estudio recién publicado</a\r\n  >&nbsp;en&nbsp;<em>The Lancet Planetary Health</em>, donde los autores han\r\n  analizado los beneficios para la salud que se alcanzarían si dichos estados\r\n  (Brasil, China, Alemania, India, Indonesia, Nigeria, Sudáfrica, Reino Unido y\r\n  Estados Unidos) ponen en marcha planes climáticos suficientemente ambiciosos.\r\n</p>\r\n<p>\r\n  Recibe la revista por solo 5€/mes +&nbsp;<strong\r\n    >Agenda 2024 National Geographic de REGALO</strong\r\n  >.\r\n</p>\r\n<p>\r\n  <a\r\n    href=\"https://tienda.rba.es/revistas/landing-suscripcion-ngme-agenda-2024?rba_source=nationalgeographic&amp;rba_medium=referral&amp;rba_campaign=ngme-agenda-2024&amp;rba_term=nationalgeographic&amp;rba_content=frase-no-suscriptor-articulo\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0); background-color: rgb(254, 206, 0)\"\r\n    >Suscríbete</a\r\n  >\r\n</p>\r\n<p>\r\n  Junto con la disminución de la contaminación, la investigación también tiene\r\n  en cuenta&nbsp;<strong\r\n    >medidas relacionadas con cambios la dieta y la movilidad activa</strong\r\n  >, que prevendrían 6,4 y 2,1 millones de muertes respectivamente.\r\n</p>\r\n<p>\r\n  La contaminación atmosférica es uno de los principales riesgos para la salud\r\n  pública.&nbsp;<a\r\n    href=\"https://www.thelancet.com/journals/lancet/article/PIIS0140-6736(20)30752-2/fulltext\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0)\"\r\n    >Un importante informe</a\r\n  >, con datos del 2019, la sitúa como una de las causas más importantes de\r\n  defunciones en el mundo, lo que supone el 12% de las muertes totales. Para\r\n  hacer el cálculo se tiene en cuenta la exposición a contaminación en ambiente\r\n  exterior (partículas finas, o PM₂,₅ y ozono) e interior (exposición al humo\r\n  por uso de combustibles sólidos).&nbsp;<strong\r\n    >Por delante solo están factores tan importantes como la presión arterial\r\n    alta, los riesgos dietéticos, la glucosa elevada y el tabaquismo</strong\r\n  >.\r\n</p>\r\n<h3>La contaminación, un problema global</h3>\r\n<p>\r\n  La contaminación del aire ambiental es un problema mundial. Se calcula que en\r\n  el año 2019, cerca del&nbsp;<strong>90% de la población mundial</strong\r\n  >&nbsp;estuvo expuesta a concentraciones medias anuales de PM₂,₅ por encima de\r\n  las recomendaciones de la Organización Mundial de la Salud (10 μg/m³). Estas\r\n  concentraciones se relacionan de manera clara con el riesgo de enfermar o\r\n  morir por enfermedades cardiovasculares, respiratorias y cáncer, entre otras.\r\n</p>\r\n<p>\r\n  A pesar de suponer un problema global, los niveles de contaminación y el\r\n  impacto que tienen sobre la salud&nbsp;<strong\r\n    >no se distribuyen de manera homogénea en el mundo</strong\r\n  >: son más elevadas en poblaciones de países del Sur y Sudeste de Asia y de\r\n  África Central, y más bajas en los países ricos.\r\n</p>\r\n<p>\r\n  Pero la contaminación del aire<strong\r\n    >&nbsp;también representa un grave problema de salud pública en\r\n    Europa</strong\r\n  >.&nbsp;<a\r\n    href=\"https://www.eea.europa.eu/publications/air-quality-in-europe-2020-report\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0)\"\r\n    >La población europea</a\r\n  >&nbsp;expuesta a concentraciones medias anuales de partículas finas y ozono\r\n  por encima de las recomendaciones en 2018 fue del 74 % y del 96 %,\r\n  respectivamente. De los dos contaminantes, las&nbsp;<strong\r\n    >partículas son las que más impacto en salud causan</strong\r\n  >, tanto en España como a nivel global. Sin embargo, se observan&nbsp;<strong\r\n    >tendencias distintas</strong\r\n  >&nbsp;en las concentraciones: en partículas finas es descendente, mientras\r\n  que en ozono va en ascenso, coincidiendo con el avance del cambio climático.\r\n</p>\r\n<p><br /></p>\r\n<blockquote class=\"ql-align-center\">\r\n  <strong\r\n    >Lo niveles de contaminación e impacto en la salud son más elevados en\r\n    poblaciones de países del Sur y Sudeste de Asia y de África Central, y más\r\n    bajas en los países ricos</strong\r\n  >\r\n</blockquote>\r\n<p>\r\n  No toda la población es igual de sensible a los efectos de la contaminación.\r\n  Las&nbsp;<strong>personas con patologías crónicas,&nbsp;</strong>especialmente\r\n  cardiorrespiratorias,<strong\r\n    >&nbsp;y los más pequeños son más vulnerables</strong\r\n  >. Las primeras etapas de la vida, incluida la gestación, son periodos de\r\n  especial vulnerabilidad, en las que una alta exposición puede conducir a un\r\n  mayor riesgo de enfermedad, invalidez o muerte.\r\n</p>\r\n<h3>Ambiente y salud infantil</h3>\r\n<p>\r\n  Desde hace 15 años, existe una&nbsp;<strong\r\n    >red de investigación de grupos españoles&nbsp;</strong\r\n  >que ha aportado información relevante sobre cómo afecta la exposición a la\r\n  contaminación atmosférica durante las primeras etapas de la vida (embarazo y\r\n  primeros años) en la salud de los niños y niñas: el&nbsp;<a\r\n    href=\"https://www.proyectoinma.org/\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0)\"\r\n    >proyecto INMA</a\r\n  >&nbsp;(Infancia y Medio Ambiente).\r\n</p>\r\n<p>\r\n  Algunos resultados de este proyecto arrojan luz sobre el&nbsp;<strong\r\n    >impacto que tiene la exposición a la contaminación sobre la salud\r\n    infantil</strong\r\n  >. Por ejemplo, se ha comprobado que los niños y niñas de madres que\r\n  estuvieron expuestas a niveles más altos de contaminación durante el embarazo\r\n  tuvieron más riesgo de retraso en el desarrollo fetal.\r\n</p>\r\n<p><br /></p>\r\n<blockquote class=\"ql-align-center\">\r\n  <strong\r\n    >Se ha relacionado la contaminación con un menor peso o talla al nacimiento,\r\n    mayor riesgo de parto prematuro y un retraso del crecimiento físico en los\r\n    primeros años de vida</strong\r\n  >\r\n</blockquote>\r\n<p>\r\n  De la misma manera, la exposición temprana a niveles altos de contaminación se\r\n  ha asociado con un&nbsp;<strong\r\n    >mayor riesgo de padecer problemas de salud</strong\r\n  >, tanto respiratorios, como del neurodesarrollo durante la infancia.\r\n</p>\r\n<h3>Emisiones y cambio climático</h3>\r\n<p>\r\n  El&nbsp;<a\r\n    href=\"https://www.nationalgeographic.com.es/temas/cambio-climatico\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0)\"\r\n    >cambio climático</a\r\n  >&nbsp;es considerado como una de las principales amenazas para la salud\r\n  pública en el siglo XXI. Según la OMS,&nbsp;<strong\r\n    >en la presente década se pueden dar 250.000 defunciones relacionadas con el\r\n    cambio climático</strong\r\n  >. Y este número se irá incrementando de forma exponencial a lo largo del\r\n  siglo si no se toman medidas decididas para variar su progresión.\r\n</p>\r\n<p>\r\n  Los cambios en el clima son debidos a las emisiones de gases de efecto\r\n  invernadero, fruto de la actividad humana. El&nbsp;<strong\r\n    >sur de Europa y el Mediterráneo son zonas consideradas como&nbsp;</strong\r\n  ><a\r\n    href=\"https://www.ipcc.ch/site/assets/uploads/sites/2/2019/03/SR15_FOD_Chapter3.pdf\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0)\"\r\n    ><strong>“puntos calientes”</strong></a\r\n  >, tanto por un mayor calentamiento como por la reducción de precipitaciones.\r\n</p>\r\n<p>\r\n  Las agencias internacionales, lideradas por el Panel Intergubernamental para\r\n  el Cambio Climático (<a\r\n    href=\"https://www.ipcc.ch/\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0)\"\r\n    >IPCC</a\r\n  >, por sus siglas en inglés), desarrollan una&nbsp;<strong\r\n    >estrategia para evitar que la temperatura media mundial supere en 1,5\r\n    ℃&nbsp;</strong\r\n  >la temperatura de la época preindustrial. Para conseguirlo se debe reducir\r\n  sensiblemente las emisiones de los GEI clásicos (CO₂, metano, N₂O) y también\r\n  de otros contaminantes que afectan al clima, como el ozono y el carbono negro.\r\n</p>\r\n<p><br /></p>\r\n<blockquote class=\"ql-align-center\">\r\n  <strong\r\n    >El sur de Europa y el Mediterráneo son zonas consideradas como “puntos\r\n    calientes”, tanto por un mayor calentamiento como por la reducción de\r\n    precipitaciones</strong\r\n  >\r\n</blockquote>\r\n<h3>Beneficios para la salud de las acciones contra el cambio climático</h3>\r\n<p>\r\n  Las estrategias de mitigación del cambio climático que se han propuesto pueden\r\n  traducirse en&nbsp;<strong\r\n    >otros logros para la salud, conocidos como&nbsp;</strong\r\n  ><a\r\n    href=\"https://www.ipcc.ch/site/assets/uploads/2018/02/WGIIAR5-Chap11_FINAL.pdf\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0)\"\r\n    ><strong>“cobeneficios”</strong></a\r\n  >. Estas acciones promueven la reducción de la contaminación atmosférica, el\r\n  aumento de la actividad física, la reducción de consumo de carne o un mayor\r\n  acceso a espacios verdes.\r\n</p>\r\n<p>\r\n  Estudios recientes han ilustrado los&nbsp;<strong\r\n    >beneficios potenciales</strong\r\n  >&nbsp;derivados de dichas acciones: la reducción en los niveles de\r\n  contaminación del aire que se derivaría de la eliminación de las emisiones de\r\n  combustibles fósiles&nbsp;<a\r\n    href=\"https://www.pnas.org/content/116/15/7192\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0)\"\r\n    >podría reducir en 3,61 millones de defunciones prematuras</a\r\n  >. El&nbsp;<a\r\n    href=\"https://pubmed.ncbi.nlm.nih.gov/25900805/\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0)\"\r\n    >incremento de la movilidad activa</a\r\n  >&nbsp;(caminar, ir en bicicleta) vendría asociado a un&nbsp;<strong\r\n    >aumento de la actividad física</strong\r\n  >, y a una reducción de contaminación atmosférica y acústica. Todo ello se\r\n  traduciría en una reducción de algunas de las principales causas de enfermedad\r\n  y muerte (por ejemplo, enfermedad isquémica, accidente cerebrovascular,\r\n  diabetes y cáncer).\r\n</p>\r\n<p>\r\n  Además, los&nbsp;<a\r\n    href=\"https://www.sciencedirect.com/science/article/abs/pii/S0140673618317884?via%3Dihub\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0)\"\r\n    >cambios en la dieta</a\r\n  >&nbsp;que irían asociados a una reducción de emisiones se pueden traducir en\r\n  un descenso de alrededor de 11 millones de muertes prematuras al año.\r\n  También&nbsp;<strong\r\n    >disminuiría la pérdida de biodiversidad y uso de agua y suelo</strong\r\n  >, factores que reducen la estabilidad de los sistemas de la Tierra.\r\n</p>\r\n<h3>Covid-19 y medio ambiente: crisis y oportunidad</h3>\r\n<p>\r\n  La pandemia de la COVID-19 está causando daños profundos a la humanidad y está\r\n  demostrando la<strong\r\n    >&nbsp;importancia de la salud pública en la protección de la salud y la\r\n    calidad de vida</strong\r\n  >&nbsp;de las personas. Además, tal como&nbsp;<a\r\n    href=\"https://www.who.int/news-room/feature-stories/detail/who-manifesto-for-a-healthy-recovery-from-covid-19\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0)\"\r\n    >indicó</a\r\n  >&nbsp;el director general de la OMS Tedros Adhanom “es un aviso de la\r\n  estrecha e íntima relación entre las personas y el planeta”.\r\n</p>\r\n<p>\r\n  En relación con la contaminación del aire, un&nbsp;<a\r\n    href=\"http://www.nature.com/articles/s41467-020-18922-7\"\r\n    rel=\"noopener noreferrer\"\r\n    target=\"_blank\"\r\n    style=\"color: rgb(0, 0, 0)\"\r\n    >estudio reciente</a\r\n  >&nbsp;ha estimado que, durante el primer semestre de 2020,&nbsp;<strong\r\n    >en España se redujeron las emisiones de CO₂ en un 18,8 %</strong\r\n  >&nbsp;respecto al mismo periodo de 2019.\r\n</p>\r\n<p>\r\n  Dichas mejoras demuestran que, con acciones decididas, es posible\r\n  conseguir&nbsp;<strong\r\n    >mejoras sustanciales en la calidad del aire que se derivan en beneficios\r\n    importantes para la salud de la población</strong\r\n  >. Esto brinda una oportunidad única para conseguir un aire más limpio,\r\n  mitigar el cambio climático, y poder avanzar en un planeta saludable y\r\n  sostenible para los más jóvenes y para las generaciones futuras.\r\n</p>',1,'kmarie','kmarie','data:image/jpeg;base64,');
