INSERT INTO `recycle_types` VALUES ('2023-11-19 22:49:50.889845','2023-11-19 22:49:50.889845',1,1,'Electrónicos (e-waste)','Incluye dispositivos electrónicos como computadoras, teléfonos móviles, electrodomésticos, etc. El reciclaje adecuado de aparatos electrónicos evita la contaminación por metales pesados y recupera materiales valiosos.','kmarie'),('2023-11-21 04:50:40.029639','2023-11-21 04:50:40.029639',1,2,'Papel y cartón','Incluye periódicos, revistas, cajas de cartón, cartulina y otros productos de papel. Se recicla para producir papel reciclado y reducir la tala de árboles.','kmarie'),('2023-11-21 04:51:01.696983','2023-11-21 04:51:01.696983',1,3,'Plástico','Envases de plástico, botellas, bolsas, y otros productos plásticos. Los diferentes tipos de plástico tienen códigos de reciclaje que indican su composición y facilitan su clasificación.','kmarie'),('2023-11-21 04:51:23.364874','2023-11-21 04:51:23.364874',1,4,'Vidrio','Botellas, frascos y otros envases de vidrio son reciclables. Se procesan para crear nuevos envases de vidrio y reducir la demanda de materias primas.','kmarie'),('2023-11-21 04:53:38.637113','2023-11-21 04:53:38.637113',1,5,'Metal','Latas de aluminio, latas de acero, envases metálicos y otros productos de metal. El reciclaje de metales ahorra energía y reduce la necesidad de extraer nuevos minerales.','kmarie');
